func (c *current) onListContinuationElement1374(cells any) (any, error) {
	var rows []*types.TableRow
	var cs []interface{}
	ci := cells.([]interface{})

	for _, c := range ci {
		cs = append(cs, c)
		switch mlc := c.(type) {
		case *types.TableCell:
			if len(mlc.Elements) == 0 {
				continue
			}
			switch rl := mlc.Elements[len(mlc.Elements)-1].(type) {
			case *types.RawLine:
				if rl.EOL {
					tr, err := types.NewTableRow(cs)
					if err != nil {
						return nil, err
					}
					rows = append(rows, tr)
					cs = make([]interface{}, 0)
					continue
				}

			}
		}

	}
	if len(cs) > 0 {
		tr, err := types.NewTableRow(cs)
		if err != nil {
			return nil, err
		}
		rows = append(rows, tr)
	}
	if len(rows) == 1 {
		return rows[0], nil
	}

	return rows, nil

}

